import React from 'react';
import Login from './components/login';
import './App.css';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      username: null
    }
  }
  render() {
    return (
      <div className="App">
        <Login credentials={(x, y) => {this.setState({x: y})}}/>
      </div>
    );
  }
}

export default App;
